import { useEffect } from "react"
import '../../assets/homeItems.css'
import KUTE from 'kute.js'
// import { Options } from 'kute.js'

function HomeItems(): JSX.Element {

    useEffect(() => {
        const observer = new IntersectionObserver((entries) => {
            entries.forEach((entry) => {
                console.log(entry)
                // entry.target.classList.toggle('show', entry.isIntersecting);
                if (entry.isIntersecting) {
                    entry.target.classList.add('show');
                } else {
                    entry.target.classList.remove('show');
                }
            });
        });

        const hiddenElement = document.querySelectorAll('.hidden');
        hiddenElement.forEach((el) => observer.observe(el));

        

    }, []);

    useEffect(() => {
        // const animateBlob1 = KUTE.fromTo(
        //     '#blob1',
        //     { path: '#blob1' },
        //     { path: '#blob2' },
        //     { repeat: 999, duration:3000, yoyo: true }
        // )

        // const animateBlob2 = KUTE.fromTo(
        //     '#blob2',
        //     { path: '#blob2' },
        //     { path: '#blob3' },
        //     { repeat: 999, duration:3000, yoyo: true }
        // )

        const animateBlob3 = KUTE.fromTo(
            '#blob1',
            { path: '#blob1' },
            { path: '#blob3' },
            { repeat: 999, duration:3000, yoyo: true }
        )

        // animateBlob1.chain(animateBlob2).chain(animateBlob3).start();
        animateBlob3.start();
    }, []);

    return (
        <>
            <section className="hidden home-section background-grey">

                <div className="item1">Learn More About Me</div>
            </section>
            <div className="spacer layer2 flip"></div>
            <section className="default home-section pastel-white">
                <div className="item2">Projectssss</div>
                <svg className="blob-motion"
                    id="visual" 
                    viewBox="0 0 960 300" 
                    width="960" height="300" 
                    xmlns="http://www.w3.org/2000/svg" 
                    version="1.1"
                >
                    <g transform="translate(489.3505193480663 160.4658443830171)">
                        <path id="blob1"
                            d="M122.5 -120.1C151.1 -93.8 161.6 -46.9 151.3 -10.3C141.1 26.4 110.1 52.8 81.5 80.1C52.8 107.5 26.4 135.7 -0.1 135.8C-26.5 135.9 -53 107.7 -85.2 80.4C-117.4 53 -155.2 26.5 -168.4 -13.3C-181.7 -53 -170.4 -106.1 -138.2 -132.4C-106.1 -158.7 -53 -158.4 -3.1 -155.3C46.9 -152.2 93.8 -146.5 122.5 -120.1" 
                            fill="#778899"
                        ></path>
                    </g>
                    {/* <g transform="translate(488.9768930446389 138.76544284294351)" style={{visibility:'hidden'}}>
                        <path id="blob2"
                            d="M87.2 -81.7C121.4 -53 163.2 -26.5 171.5 8.3C179.8 43.1 154.6 86.3 120.4 116.8C86.3 147.3 43.1 165.1 -1.9 167C-46.9 168.9 -93.8 154.8 -131.3 124.3C-168.8 93.8 -196.9 46.9 -190 7C-183 -33 -141 -66 -103.5 -94.7C-66 -123.3 -33 -147.7 -3.2 -144.4C26.5 -141.2 53 -110.4 87.2 -81.7" 
                            fill="#778899"
                        ></path>
                    </g> */}
                    <g transform="translate(515.007918847961 156.15061769825763)">
                        <path id='blob3'
                            d="M93.7 -103.1C112.5 -75 112.5 -37.5 110.4 -2.1C108.2 33.2 104 66.5 85.2 85.6C66.5 104.8 33.2 109.9 -9.9 119.8C-53 129.7 -106.1 144.4 -140.1 125.2C-174.1 106.1 -189 53 -177.5 11.5C-165.9 -29.9 -127.9 -59.9 -93.9 -88C-59.9 -116.2 -29.9 -142.6 3.8 -146.4C37.5 -150.1 75 -131.3 93.7 -103.1" 
                            fill="#778899"
                        ></path>
                    </g>
                </svg>
            </section>
            <div className="spacer layer2 "></div>
            <section className="default home-section bubble header-grey">
                <div className="item3">Contact Info</div>
            </section>
        </>
    )
}

export default HomeItems
